import React from "react";
import { Scene } from "sprite-react";

interface CharProps {}

const charComponent: React.FC<CharProps> = (props) => {
  return (
    <div>
      <h1>Char</h1>
      <sprite
        pos={[100, 100]}
        bgcolor={this.state.color}
        size={[50, 50]}
        onClick={this.handleClick.bind(this)}
      ></sprite>
    </div>
  );
};

export default charComponent;
